import React from 'react';

const Navbar = () => {
    return (
        <header className="flex items-center justify-between p-4 bg-white text-gray-800 border-b border-gray-300">
            <div className="text-2xl font-bold">
                <h2>
                    Tutor<span className="text-blue-600">G</span>
                </h2>
            </div>
            <div className="flex items-center gap-3 w-full max-w-md">
                <select className="p-2 border border-gray-300 rounded">
                    <option>Browse</option>
                    <option>Category 1</option>
                    <option>Category 2</option>
                </select>
                <input
                    type="text"
                    placeholder="What do you want to learn..."
                    className="p-2 border border-gray-300 rounded w-full"
                />
            </div>
            <div className="flex gap-4">
                <span className="text-xl cursor-pointer">üîî</span> {/* Notification Icon */}
                <span className="text-xl cursor-pointer">‚ù§Ô∏è</span> {/* Favorite Icon */}
                <span className="text-xl cursor-pointer">üõí</span> {/* Cart Icon */}
            </div>
            <div className="flex gap-2">
                <button className="px-4 py-2 bg-orange-500 text-white rounded transition duration-300 ease-in-out hover:bg-orange-600">
                    Create Account
                </button>
                <button className="px-4 py-2 text-orange-500 border border-orange-500 rounded transition duration-300 ease-in-out hover:bg-orange-500 hover:text-white">
                    Sign In
                </button>
            </div>
        </header>
    );
};

export default Navbar;
